import React from "react";
import GlobalStyle from "../../styles/Global.css";
import Logo from "../../imgs"

const { ContainerLogo } = GlobalStyle

function LogoComp() {


    return (
        <ContainerLogo>
            <img style={{maxWidth: "100px"}} src="https://sun1-88.userapi.com/impg/6Moy7Dq1tpvq8K67n6KYE_q5DR2QuaZ3UZFq-Q/oFe1jbFXT14.jpg?size=2560x764&quality=96&sign=06bcfa08d88405909224b22bcf5e5964&type=album" alt="МИИГАиК" />
        </ContainerLogo>
    )
}

export default LogoComp
